function InfoTooltip() {
  return (
    <div class="popup popup_info">
      <div class="popup__container">
        <img />
        <button type="button" class="popup__close-button" aria-label="Закрыть"></button>
      </div>
    </div>
  );
}

export default InfoTooltip;
